import { Text, View } from '../components/Themed';
import { RootTabScreenProps } from '../types';

export default function CsvInput({ navigation }: RootTabScreenProps<'CsvInput'>) {
  return (
    <View style={styles.container}>
      <Dropzone onDrop={()=>{}}>
          <Text>TEXT HERE</Text> // you can remove this completely
      </Dropzone>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
